DROGAS - didžiausias sveikatos, grožio ir namų prekių parduotuvių tinklas Baltijos šalyse. Čia galima rasti daugiau nei 12 000 sveikatos, grožio ir namų prekių patraukliausiomis kainomis;
Greitas, lengvas ir patogus apsipirkimas;
Greitas ir saugus pirkimo apmokėjimas;
Greitai ir lengvairasite naujausias akcijas ir geriausius pasiūlymus;
Daugybė puikių pasiūlymų su DROGAS kortele;
Paprasta ir patogu patikrinti turimų lojalumo taškų balansą, atnaujinti savo profilio informaciją;
Lengva ir patogu sekti savo užsakymą bei peržiūrėti užsakymų istoriją;
Galimybė pasirinkti patogiausią pristatymo būdą:
- Pristatymo kaina pasirinkus pristatymą į DPD PICK UP siuntų taškus – 1,90 €. Perkant už 19,99 € ir daugiau – pristatymas NEMOKAMAS!
- Pristatymo kaina pasirinkus KURJERIO paslaugą – 2,90 €. Perkant už 19,99 € ir daugiau – pristatymas NEMOKAMAS!
- Pristatymo kaina pasirinkus pristatymą į pasirinktą DROGAS parduotuvę 1,49 € . Perkant už 10,00 € ir daugiau – pristatymas NEMOKAMAS!

Leiskite pasirūpinti Jūsų automobilio švara „Švaros brolių“ profesionalams. Rezervuoti laiką automobilio švarai per ŠVAROS CENTRŲ programėlę itin paprasta, patogu ir greita.

Nuo šiol su nauja ŠVAROS CENTRŲ mobiliąja programėle galite:
 - Kelių mygtukų paspaudimu rezervuoti laiką automobilio švarai;
 - Matyti švaros centrų užimtumą ir pasirinkti Jums tinkamiausią centrą;
 - Lengvai valdyti pasirinktą apsilankymo laiką: keisti ar atšaukti;
 - Susipažinti su švaros centrų paslaugų paketais bei pasirinkti sau tinkamiausią;
 - Gauti sms pranešimus, kai Jūsų automobilis bus paruoštas;

Atsisiųskite ŠVAROS CENTRŲ programėlę ir lengvai rezervuokite bei valdykite savo laiką, o mes pasirūpinsime Jūsų automobilio nepriekaištinga švara.
